import "./footer.css";
import Logo from "./pages/SyImg/Logo.png";

const Footerr = () => {
  return (
    <div className="footer">
      <img src={Logo} alt="logo" />
      <div>
        Sy Makina olarak kalıcı çözümler sunuyoruz.
        <hr /> Mustafa Kemal Mah. 2124. Cad Mertsan Plaza No:15/12
        Çankaya/ANKARA Saraykent Sanayi Sitesi 100. Yıl Blv. No:67
        Kahramankazan/ANKARA +90 312 360 23 61 +90 533 654 90 01
        info@volmak.com.tr
      </div>
      <br />
      <br />
      SY Makina A.Ş. 2021 Bütün Hakları Saklıdır.
      <a
        href="https://www.instagram.com/q._.tay/"
        target="blank"
        className="footer2"
      >
        Designed by K.Ş
      </a>
    </div>
  );
};

export default Footerr;
